import React, { useState } from "react";
// import { capitalizeFirstLetter } from "../../utils/helpers";
import {
  Typography,
  Card,
  CardContent,
  CardMedia,
  CssBaseline,
  Grid,
  Container,
  CardActions,
} from "@material-ui/core";
import Horiseon from "../../assets/Dinner-N-Movie.png";

const portfolio = [
  {
    Project: 1,
    title: "Horiseon",
    website: "https://riveradenisse.github.io/HoriseonW1/",
    image: Horiseon,
    repository: "https://github.com/RiveraDenisse/HoriseonW1",
  },
];

function Gallery(props) {
  const [classes] = useState([]);
  return (
    <div className="m-3">
      <Card className="w-100 h-100">
        <Card.Img src={props.project.image} alt={props.project.title} />
        <Card.ImgOverlay>
          <Card.Body>
            <Card.Title>{props.project.title}</Card.Title>
            <Card.Text>{props.project.description}</Card.Text>
            <Card.Text>{props.project.tools}</Card.Text>
          </Card.Body>
          <Card.Footer>
            <Card.Link
              href={props.project.gitLink}
              target="_blank"
              rel="noreferrer"
            >
              GitHub Repository
            </Card.Link>
            <Card.Link
              href={props.project.deployedLink}
              target="_blank"
              rel="noreferrer"
            >
              Deployed Application
            </Card.Link>
          </Card.Footer>
        </Card.ImgOverlay>
      </Card>
    </div>
  );
}
export default Gallery;
